import React, { useState } from 'react';
import styles from './Pagination.module.scss';

interface IProps {
    currentPage: number,
    totalPages: number,
    setPage: () => void,
}

export default function Pagination({ currentPage, totalPages, setPage }: IProps) {

    function handlePageChange(newPage: number) {

    }
    return (
        <div className={styles.pagination} >
            <button className={styles.pagination__button}
                onClick={
                    () => handlePageChange(currentPage - 1)
                }
                disabled={
                    currentPage === 1
                }
            > &laquo;
            </button> {
                Array.from({
                    length: totalPages
                }, (_, index) => (<button key={
                    index + 1
                }
                    
                    onClick={
                        () => handlePageChange(index + 1)
                    }
                > {
                        index + 1
                    }
                </button>))
            }

            <button className={styles.pagination__button}
                onClick={
                    () => handlePageChange(currentPage + 1)
                }
                disabled={
                    currentPage === totalPages
                }
            > &raquo;
            </button>
        </div>
    );
}
